column24:
Areas of Typha orientalis sedgeland and clumps of Arum zealandicus upstream
from river mouth. Above this is Juncus kraussii open sedgeland backed by Melaleuca rhaphiophylla low open forest or Eucalyptus rudis open forest with understorey of M. rhaphiophylla,
Agonis flexuosa and pasture grasses. Above this is Tuart Eucalyptus gomphocephala high woodland.
